import React from "react";
import Box3x3 from "../Box3x3/Box3x3";
import classes from "./Box9x9.module.css"

const Box9x9 = ({getId}) => {
    // Block
        // |  1  2  3 |
        // |  4  5  6 |
        // |  7  8  9 |
    return (
        <div className={classes.BigBox}>
        <div className={classes.Box9x3}>
      <Box3x3 click={getId} id={"One"}/>
      <Box3x3 click={getId} id={"Two"}/>
      <Box3x3 click={getId} id={"Three"}/>
      </div>
      <div className={classes.Box9x3}>
      <Box3x3 click={getId} id={"Four"}/>
      <Box3x3 click={getId} id={"Five"}/>
      <Box3x3 click={getId} id={"Six"}/>
      </div>
      <div className={classes.Box9x3}>
      <Box3x3 click={getId} id={"Seven"}/>
      <Box3x3 click={getId} id={"Eight"}/>
      <Box3x3 click={getId} id={"Nine"}/>
      </div>
        </div>
    );
};

export default Box9x9;
